import React from 'react';
import withData from '../../with-data'; 


const TestUserList = ({data}) => (

   <div className="container">
    <h1>User List</h1>
    {data.map(user => 
        <div className='post'>
            <h1>{user.name}</h1>
            <h2>{user.email}</h2>
        </div>
        )}
    </div>


)
export default withData(TestUserList, 'https://jsonplaceholder.typicode.com/users')
